// import * as THREE from "three"
import { ScatterGL } from "scatter-gl"
import * as facemesh from '@tensorflow-models/facemesh'


let scatterGL = new ScatterGL(document.querySelector('#scatter-gl-container'), { 'rotateOnStart': false, 'selectEnabled': true });
let model;
async function main(){
    model = await facemesh.load();
}

